export const LOGIN = 'LOGIN'
export const REGISTER = 'REGISTER'


export const register=(userId)=>{
    return{
        type:REGISTER,
        userId:userId
    }
}

export const login=(userId)=>{
    return{
        type:LOGIN,
        userId:userId
    }
}
